import React from 'react'

const Signature = () => {
    return(
        <>
            <div className="choice">
                <img src="/img/choice_first.png" alt=""/>
                <img src="/img/citrus_img.png" alt=""/>
                <img src="/img/floral_img.png" alt=""/>
                <img src="/img/fruity_img.png" alt=""/>
                <span>Citrus / 레몬향</span>
                <span>Floral / 꽃향기</span>
                <span>Fruity / 과일향</span>
                <img src="/img/green_img.png" alt=""/>
                <img src="/img/woody_img.png" alt=""/>
                <img src="/img/musk_img.png" alt=""/>
                <span>Green / 풀 향</span>
                <span>Woody / 로즈우드향</span>
                <span>Musk / 사향여우털향</span>
            </div>
        </>
    );
};

export default Signature;
